import React from "react";
import { NavBar } from "../NavBar/NavBar";
import logo from "../../img/ilumi.png"
import styles from "./Home.module.css"

export const Home = () => {
  return (
    <div>
      <div>
        <NavBar />
      </div>
      <img className={styles.img} src={logo} alt="Logo" />
    </div>
  );
};
